import './App.css';
import NavBar from './Components/NavBar';
function App() {
  return (
    <div className="App">
      <div className='container'>
        <NavBar></NavBar>
        <div className='explore'><h2>Explore</h2></div>
        <div className='what'><h3>What are you gonna watch today ?</h3></div>
      </div>

    </div>
  );
}

export default App;
